import React from "react";
import Banner from "../components/Banner";
import Heading from "../components/Heading";

const Homepage = () => {
  return (
    <section className="max-container px-5">
      <Banner />
      <div className="mt-10">
        <Heading title={"Categories"} />
        <h1 className="mt-2 font-semibold text-xl">Browse By Category</h1>
        <div>
          <div className="h-20 w-20 bg-orange-200">
            <div className="h-14 w-14 bg-orange-500"></div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Homepage;
